import React from 'react';
import ReactDOM from 'react-dom';

const h1Style = {
    color: 'red'
};

function cssStyle(props){
    return <h1 style={h1Style}>{props.msg}</h1>
}

const CssStyleComp = <cssStyle msg="Hello from React App!"/>;
export default CssStyleComp;
